DROP TABLE IF EXISTS `edu_wx_user_info`;
CREATE TABLE `edu_wx_user_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `open_id` varchar(64) COLLATE utf8_bin NOT NULL,
  `user_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '用户Id',
  `nick_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `avatar_img` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `gender` tinyint(4) DEFAULT NULL COMMENT '性别(0:未知1:男,2:女)',
  `city` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `province` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `country` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `language` varchar(128) COLLATE utf8_bin DEFAULT NULL,
  `mobile` varchar(32) COLLATE utf8_bin DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL COMMENT '状态（1.开启.2关闭）',
  `promo_code` varchar(64) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '推广码',
  `union_id` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `wx_resource` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '微信用户来源',
  `public_open_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '商家公众号open_id',
  `location` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '获取手机号码的地理位置',
  `lng` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '经度',
  `lat` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '纬度',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `member_code` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '会员卡标识code',
  `is_member` int(2) NOT NULL DEFAULT '0' COMMENT '会员标识(0否,1是)',
  `member_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '获取会员时间',
  `delete_flag` int(4) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  UNIQUE KEY `un_open_id` (`open_id`) USING BTREE,
  UNIQUE KEY `idx_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3581 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC;

